PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE user (
	id INTEGER NOT NULL, 
	"Username" VARCHAR(80) NOT NULL, 
	email VARCHAR(120) NOT NULL, 
	password TEXT NOT NULL, 
	created_at DATETIME, 
	updated_at DATETIME, 
	PRIMARY KEY (id), 
	UNIQUE ("Username"), 
	UNIQUE (email)
);
CREATE TABLE bookmark (
	id INTEGER NOT NULL, 
	body TEXT, 
	url TEXT NOT NULL, 
	title TEXT NOT NULL, 
	user_id INTEGER, 
	category TEXT, 
	icon TEXT, 
	created_at DATETIME, 
	updated_at DATETIME, 
	PRIMARY KEY (id), 
	FOREIGN KEY(user_id) REFERENCES user (id)
);
COMMIT;
